/////////////////////////////////////////////////////////////////////////////////////////////\n  signUp(info: SignupFormData) {\n    //info.password = this.SHA1(info.password);\n\n    const options = {\n      method: 'POST',\n      url: signupUrl,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json'\n      },\n      body : info,\n      json: true\n    };\n    console.log(options);\n\n    return this.http.request('POST', LoginUrl, options);\n  }\n  /////////////////////////////////////////////////////////////////////////////////////////////////////////////\n//                                           LOGIN\n  /**\n   * @description Send a POST request to the API to authenticate a user.\n   * @param LoginInfo username and email of client in a JSON object.\n   */\n/////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  login(info: LoginInfo) {\n    // info.password = this.SHA1(info.password);\n    const options = {\n      method: 'POST',\n      url: LoginUrl,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n      },\n      body : info,\n      json: true\n    };\n    console.log(options);\n\n    return this.http.request('POST', LoginUrl, options);\n\n  }\n  /////////////////////////////////////////////////////////////////////////////////////////////////////////////\n//                                           SUBMIT CLIENT FORM\n  /**\n   * @description Send a POST request to the API to submit form data submitted by a client\n   * @param ClientFormData : data submitted by client form in a JSON object\n   */\n/////////////////////////////////////////////////////////////////////////////////////////////////////////////\n  submitForm(info: ClientFormData) {\n    const options = {\n      method: 'POST',\n      url: formUrl,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json'\n      },\n      body : info,\n      json: true\n    };\n    console.log(options);\n\n    return this.http.request('POST', formUrl, options);\n  }\n\n\n  /**\n   *\n   *  Secure Hash Algorithm (SHA1)\n   *  http://www.webtoolkit.info/\n   *\n   **/\n\n  SHA1(msg) {\n\n    function rotate_left(n,s) {\n      var t4 = ( n>>(32-s));\n      return t4;\n    };\n\n    function lsb_hex(val) {\n      var str=\"\";\n      var i;\n      var vh;\n      var vl;\n\n      for( i=0; i>>(i*4+4))&0x0f;\n        vl = (val>>>(i*4))&0x0f;\n        str += vh.toString(16) + vl.toString(16);\n      }\n      return str;\n    };\n\n    function cvt_hex(val) {\n      var str=\"\";\n      var i;\n      var v;\n\n      for( i=7; i>=0; i-- ) {\n        v = (val>>>(i*4))&0x0f;\n        str += v.toString(16);\n      }\n      return str;\n    };\n\n\n    function Utf8Encode(string) {\n      string = string.replace(/\\r\\n/g,\"\\n\");\n      var utftext = \"\";\n\n      for (var n = 0; n  127) && (c > 6) | 192);\n          utftext += String.fromCharCode((c & 63) | 128);\n        }\n        else {\n          utftext += String.fromCharCode((c >> 12) | 224);\n          utftext += String.fromCharCode(((c >> 6) & 63) | 128);\n          utftext += String.fromCharCode((c & 63) | 128);\n        }\n\n      }\n\n      return utftext;\n    };\n\n    var blockstart;\n    var i, j;\n    var W = new Array(80);\n    var H0 = 0x67452301;\n    var H1 = 0xEFCDAB89;\n    var H2 = 0x98BADCFE;\n    var H3 = 0x10325476;\n    var H4 = 0xC3D2E1F0;\n    var A, B, C, D, E;\n    var temp;\n\n    msg = Utf8Encode(msg);\n\n    var msg_len = msg.length;\n\n    var word_array = new Array();\n    for( i=0; i>>29 );\n    word_array.push( (msg_len\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/LoginComponent.html":{"url":"components/LoginComponent.html","title":"component - LoginComponent","body":"\n                   \